import React from "react";
import AdmiPanel from "./components/AdmiPanel";
import producto from "./components/producto";

function App() {
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>Rellenitas</h1>
      <AdmiPanel />
      <producto />
    </div>
  );
}

export default App;
